import React from "react";
import "./components.css"
import Button from "./Button"

class LineItem extends React.Component {
    constructor(props) {
        super(props);
    }
    render() {
        return (
            <div className="line-item">
                <l1 className="line-left" >{this.props.item.domain}</l1>
                <a className="line-right" >{this.props.item.range}</a>
                <Button className="line-button" clickHandler={this.props.clickHandler(this.props.item.id)}> </Button>
            </div>
        )
    }

}

export default LineItem;
